import React from "react";
import ReactDOM from "react-dom";
import "./Playlist.css";
import SideBar from "../SideBar/SideBar";
import Header from "../Header/Header";
import Card from "../MainComp/Body/Card/Card";
export default function Playlist(){

window.addEventListener("load",()=>{

        var key = localStorage.length-1;
        const arr=["k","a","i"];
        while(key > 0){
            const obj = JSON.parse(localStorage.getItem(key));
            ReactDOM.render(
                <>
                {/* <Card img={obj.img} title={obj.title} artist={obj.artist} src={obj.src} /> */}
                {arr.map((value)=>{
                   return(
                    <>
                    <h1>{value}</h1>
                    </>
                   )
                })
            }
                </>,
                 document.getElementById("p-result")
            )
            key--;
        }
        
    document.getElementById("h1").style.visibility="hidden";

})

    return(
        <>
         <div className="main">
            <div className="p">
                 <h1 style={{color:"darkgray"}} id="h1">You don't have any Playlist Currently !</h1>
                  <div className="p-result" id="p-result">
                    
                  </div>
            </div>
            <Header />
            <SideBar />
         </div>
        </>
    )
}
